import * as React from "react";
import { Grid, Drawer, AppBar, Toolbar } from "@mui/material";

type Props = {
  children?: React.ReactNode;
};

export default function PageWrapper({ children }: Props): JSX.Element {
  const [open, setOpen] = React.useState(false);
  return (
    <Grid
      item
      xs={12}
      sx={{
        height: "100vh",
        display: "flex",
        alignItems: "center",
        padding: "60px",
      }}
    >
      {children}
      <AppBar position="absolute" open={open} color="secondary">
        <Toolbar color="secondary">
          <Grid
            container
            direction="row"
            sx={{
              display: "flex",
              alignItems: "center",
              justifyContent: "space-between",
              width: "100%",
            }}
          >
            <Grid
              item
              sx={{
                display: "flex",
                flexDirection: "row",
                alignItems: "center",
              }}
            ></Grid>
            <Grid
              item
              sx={{
                display: "flex",
                flexDirection: "row",
                alignItems: "center",
              }}
            ></Grid>
          </Grid>
        </Toolbar>
      </AppBar>
      <Drawer variant="permanent" open={open} sx={{}}></Drawer>
    </Grid>
  );
}
